import React from 'react';
import { Link } from 'react-router-dom';

const NotFound = () => {
    return (
        <div>
            Ты не туда попал, <br /> <h1>404</h1>
            <Link to="/">На главную</Link>
        </div>
    );
}

export {NotFound};
